import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import {Link} from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import "./Header.css";
import MenuTap from './MenuTap';
function Header(){



    return (
    <Navbar  expand="lg">
        <Container id="test">
        <Navbar.Brand href="#home">Wapkiosk</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
            <Link className="Navs" href="#home">Home</Link>
            <Link className="Navs" href="/menu">메뉴선택</Link>
            <Link className="Navs" href="#todayOrder">주문조회</Link>
            <Link className="Navs" href="#beforeOrder">이전주문조회</Link>
            </Nav>
        </Navbar.Collapse>
        </Container>
    </Navbar>
    );
    }

export default Header;
